node.text:
รักใคร ห่วงใคร อย่าลืมส่งเพลงนี้ให้เค้านะ รักนะการ์ดอย่าตก
https://youtu.be/uZfKNvUwLw8

เพียงเพื่อนๆ Cover หรือ Share คลิปเพลง “รักนะการ์ดอย่าตก” พร้อมติด #รักนะการ์ดอย่าตก #คาโอ #เพลงบอกรักช่วงปลดล็อก โพสท์ลงในช่องทางโซเชียลของตนเองแล้วตั้งค่าเป็นสาธารณะ เพื่อช่วยย้ำเตือนคนใกล้ตัวให้ดูแลความสะอาด 

เพื่อนๆ ยังได้เป็นส่วนร่วมในการบริจาคผลิตภัณฑ์ดูแลความสะอาด “ถุงคาโอ การ์ดอย่าตก” แก่กระทรวงสาธารณสุข เพื่อมอบให้กับผู้ได้รับผลกระทบจากสถานการณ์ Covid-19 อีกด้วยนะ

